css:
@-moz-document domain("techstart.dk") {
#siteBody
{
	background-color: #000000 !important;	
}

#siteContent div
{
	background-color: #303030 !important;
	color: #D0D0D0 !important;
}

#siteContent div table tbody tr td a h1
{
	color: #A0A0A0 !important;
}

blockquote
{
	background-color: #505050 !important;
	color: #E0E0E0 !important;
}

textarea
{
	background-color: #505050 !important;
	color: #E0E0E0 !important;
}

hr.lineRed
{
	color: #000000 !important;
	border-color: #000000 !important;
}

hr.lineThickDotted
{
	background-color: #000000 !important;
	border-color: #000000 !important;
}

#siteContent div table tbody tr td table
{
	background-color: #303030 !important;
	color: #D0D0D0 !important;
}

#topMenu
{
	background-color: #101010 !important;
	color: #D0D0D0 !important;
}

#topMenuLeft a
{
	color: #C0C0C0 !important;
}

#siteContent div table tbody tr td table tbody tr td table tbody tr td
{
	background-color: #404850 !important;
}

}
